import React from 'react';

import './custom-button.styles.scss';

const CustomButton = ({children, handleSubmit, ...otherProps}) => {
    return (
        <div className="custom-button" {...otherProps} onClick={handleSubmit}>
            {children}
        </div>
    )
}

export default CustomButton;
